package graphviz;

import SolidityInfo.SolidityVersionUnknownException;
import parseTree.Cfg;
import parseTree.Contract;

public class MainGV {

    public static void main(String[] args){
        String ottOtt = "";
        String pippo = "";
        String ballot = "";
        String testString = "";
        String ballotSimple = "";
        String empty = "6080604052348015600f57600080fd5b50603f80601d6000396000f3fe6080604052600080fdfea26469706673582212208960952bc3a2554d91c419447abb95d474a8d5d3273e5fb769dded7df97878d464736f6c63430006040033";
        String publicFields = "";
        String contractBytecode = "";
        String testFunctionsNew = "";
        String testFunctionsOld = "";
        String dao = "";
        String complexInput = "";
        String event = "";
        String undetectableFallback = "";

        String abiTest = "";

        Contract contract = new Contract("OttOtt", abiTest);

        String solidity_version;
        try {
            solidity_version = contract.getExactSolidityVersion();
            System.out.println("Solidity version: " + solidity_version);
        } catch (SolidityVersionUnknownException e) {
            solidity_version = "unknown or before 0.5.9";
            e.printStackTrace();
        }

        String data_pre_cfg = contract.getRuntime().getRemainingData();
        System.out.println("Data pre cfg: \"" + data_pre_cfg + '"');

        long pre = System.currentTimeMillis();
        Cfg generated_cfg = contract.getRuntimeCfg();
        long post = System.currentTimeMillis();
        System.out.println("ELAPSED TIME: " + (post-pre));

        String data_post_cfg = contract.getRuntime().getRemainingData();
        System.out.println("Data post cfg: \"" + data_post_cfg + '"');

        //CFGPrinter.saveAndShow(contract.getRuntimeCfg());
        String svgPath = CFGPrinter.save(generated_cfg);
        String reportPath = CFGPrinter.createReport(svgPath, solidity_version, post-pre, data_pre_cfg, data_post_cfg);
        CFGPrinter.openHtmlReport(reportPath);
    }

}
